- type: RichText
  properties: {role: null, align: left, tooltip: '', enable_slots: true, border: '',
    foreground: '', visible: true, font_size: null, content: "1.\tInt\xe9r\xeat de\
      \ la visite du site\n\nLe circuit indiqu\xe9 sur les figures 1 et 2, long de\
      \ 3.5 km environ, nous am\xe8ne au c\u0153ur du synclinal perch\xe9 \xe9oc\xe8\
      ne de Dyr El Kef (fig.2, photo 1). Il s\u2019agit d\u2019une structure g\xe9\
      ologique en forme de fond de bateau dont les bords plongent de 10 \xe0 20\xb0\
      \ vers le c\u0153ur de la structure. Le tron\xe7on qui s\u2019\xe9tend au nord\
      \ de la ville du Kef couvre environ 6 km2 et culmine localement \xe0 900m. Le\
      \ pli affecte une imposante barre de calcaires \xe0 nummulites de 60 m d\u2019\
      \xe9paisseur. Le synclinal est perch\xe9 puisque les roches qui le constituent\
      \ sont sur\xe9lev\xe9es par rapport \xe0 celles qui l\u2019encadrent de par\
      \ et d\u2019autre (fig. 2 et photo).\nCe site, en plus de son int\xe9r\xeat\
      \ g\xe9ologique \xe9vident, pr\xe9sente un int\xe9r\xeat paysag\xe9 marqu\xe9\
      \ essentiellement par la forme concave dessin\xe9e par la dalle de calcaires\
      \ \xe0 nummulites, la pr\xe9sence de grottes ou cavit\xe9 karstiques, de failles\
      \ d\u2019o\xf9 \xe9mergent la source de Sidi Mansour qui alimente la r\xe9gion\
      \ en eau potable depuis des mill\xe9naires (fig.2). C\u2019est aussi une r\xe9\
      gion verdoyante et giboyeuse. Historiquement la r\xe9gion est d\xe9crite comme\
      \ une zone de refuge de l\u2019homme pr\xe9historique comme l\u2019atteste les\
      \ peintures rupestres encore visibles dans la localit\xe9 dite esh-Sheguega\
      \ (Tlili Mohamed, historien). \nLe site pr\xe9sente aussi un int\xe9r\xeat p\xe9\
      dagogique. Les \xe9l\xe8ves du secondaire en faisant des lev\xe9s de coupes\
      \ g\xe9ologique et de carte et de comprendre la formation et l\u2019\xe9volution\
      \ d\u2019une telle structure. Ils observent et dessinent les roches s\xe9dimentaires\
      \ et leurs fossiles repr\xe9sent\xe9s ici par une lumachelle de nummulites (photo).\
      \ Ils apprennent \xe0 lire une carte g\xe9ologique, apprendre ce que c\u2019\
      est qu\u2019un affleurement, une roche, min\xe9ral.\n", font: '', spacing_above: small,
    spacing_below: small, data: null, background: '', format: markdown}
