- type: RichText
  properties: {role: null, align: left, tooltip: '', enable_slots: true, border: '',
    foreground: '', visible: true, font_size: null, content: "La structure du synclinal\
      \ perch\xe9 de Dyr El Kef est l\u2019aboutissement d\u2019une s\xe9rie de d\xe9\
      formations subies par la r\xe9gion depuis -250 Ma jusqu\u2019\xe0 l\u2019actuel.\n\
      \uf0d8\tLes couches qui forment le synclinal se sont d\xe9pos\xe9es \xe0 l\u2019\
      horizontal (fig. 3a) sous l\u2019eau ou en continent entre le Trias (-245 Ma)\
      \  et le Mioc\xe8ne sup\xe9rieur  (-5.3 Ma). Ce processus est synchrone avec\
      \ le d\xe9placement de la plaque africaine vers l\u2019Est par rapport \xe0\
      \ la plaque europ\xe9enne. C\u2019est la d\xe9rive des continents. Les plaques\
      \ s\u2019\xe9loignent ou glissent les unes par rapport aux autres. On parle\
      \ tectonique distensive. La tectonique distensive donne naissance aux oc\xe9\
      ans.\n\uf0d8\tAu Cr\xe9tac\xe9 sup\xe9rieur (70 Ma), la plaque africaine amorce\
      \ une remont\xe9e vers le Nord, vers la plaque europ\xe9enne. Les deux plaques\
      \ entrent alors en collision en donnant naissance aux chaines de montagnes (fig.3b,\
      \ c). En Tunisie septentrionale, la formation des chaines de montagnes est d\u2019\
      \xe2ge Mioc\xe8ne sup\xe9rieur (-5.3 Ma) au Plioc\xe8ne (-1.8 Ma). Post\xe9\
      rieurement \xe0 leur formation les chaines de montagnes ont subi de profondes\
      \ modifications (d\xe9mant\xe8lement, \xe9rosion) \xe0 l\u2019origine des g\xe9\
      ologiques actuelles. \n\nIV.\tEn savoir plus : \n\nR\xe9f\xe9rences bibliographiques\n\
      Habib  bensalem (2018)- Dyr el Kef - WordPress.com\nSchoeller Henri(1948)- Le\
      \ r\xe9gime hydrog\xe9ologique des calcaires \xe9oc\xe8nes du synclinal du Dyr\
      \ El Kef (Tunisie) .Bull. Soc. G\xe9ol. Fr \nPersonnes ressources\n-\tMongi\
      \ Chikhaoui e-mail: Chikhaoui_mongi@yahoo.fr\n-\tMohamed Tlili, Municipalit\xe9\
      \ du Kef\n-\tHabib Ben Salem : https://www.facebook.com/habib.bensalem.77985\n\
      \n\n", font: '', spacing_above: small, spacing_below: small, data: null, background: '',
